const styles = theme => ({
    root: {},
    nameContainer: {
        display: 'flex',
        alignItems: 'center'
    },
    avatar: {
        marginRight: theme.spacing(2)
    },
    content: {
        padding: 0
    },
    actions: {
        justifyContent: 'flex-end'
    },
    iconCardMember: {
        marginRight: '10px'
    },
    uploadButton: {
        marginRight: theme.spacing(2)
    },
    input: {
        display: 'none'
    }
});
export default styles;
